import React, { useState, useEffect } from 'react'
import { ListGroup, ListGroupItem, ListGroupItemHeading, ListGroupItemText, Button, Container } from 'reactstrap'

const ApartmentIndex = props => {
  const [apts, setApts] = useState([])
  return(
    <>
      <h3>Your Apartment Listings</h3>
      <a href="/">Home</a>
      <Container>
      <ListGroup>
        {props.apts.map((apt,index) => {
          return(
            <ListGroupItem key={index}>
              <ListGroupItemHeading><a href={`/apartments/${apt.id}`}>{ apt.subject }</a></ListGroupItemHeading>
              <ListGroupItemText>
              { apt.city}, { apt.state } <br/>
              { apt.description }
              </ListGroupItemText>
            </ListGroupItem>
          )
        })}
      </ListGroup>
      </Container>
    </>
  )
}

export default ApartmentIndex
